import styled from "styled-components";

export const Transaction = styled.div`
  position: relative;
  left: 45%;
  bottom: 8em;
  .contain {
    background-color: black;
    color: white;
    width: 50%;
    padding: 0.5em 0em;
  }
  .contain .list {
    list-style: none;
  }
  .contain .list li {
    padding: 1em;
    display: block;
    cursor: pointer;
  }
  .contain .list li:hover {
    background-color: white;
    color: black;
  }
`;
